import React, { useContext, useEffect, useState } from 'react'

const Data = () => {

    const [data, setData] = useState('')


    const fetchData = async()=>{
        const api = await fetch('https://www.terriblytinytales.com/test.txt')
        const json = await api.te;
        setData(json)
    }

    useEffect(()=>{
        fetchData()
    },[])

  return (
    <div className='data'>
        {data}
    </div>
  )
}

export default Data
